import base64

if __name__ == '__main__':
    data = ""
    # data = ""
    with open('./img/2.jpg'.format(data), 'wb') as file:
        jiema = base64.b64decode(data)  # 解码
        file.write(jiema)  # 将解码得到的数据写入到图片中
